import "./quemSomos.css";
import QuemSomosRow from "./QuemSomosRow/QuemSomosRow";

const QuemSomos = () => {
    const src = "https://instagram.fnvt6-1.fna.fbcdn.net/v/t51.2885-15/175265232_2528641284112255_2332663702619815867_n.jpg?stp=dst-jpg_e35&_nc_ht=instagram.fnvt6-1.fna.fbcdn.net&_nc_cat=107&_nc_ohc=FDrtNwCfu5sAX_2rLdh&edm=ALQROFkBAAAA&ccb=7-5&ig_cache_key=MjU1OTA0OTUxMDg5NjMwOTg2NQ%3D%3D.2-ccb7-5&oh=00_AT8-52cKUYMU5Z7wbAr5rrvbGuB6RUTsRa0CVr5Gtr5csQ&oe=62FCE95D&_nc_sid=30a2ef";

    return (
        <div className="QuemSomos">
            <div className="QuemSomosBox">
                <QuemSomosRow src={src} title="Fabio Renato dos Santos Neto" subtitle="Vice-Presidente"/>
            </div>
        </div>
    )
}

export default QuemSomos;
